def generate_asm_code(curr):
    global funcs, code_dict, visited

    dis = ''
    branches = []
    
    while not 'ret' in disasmed[curr]:
        line = disasmed[curr]
        visited.append(curr)

        if 'call' in line:
            call_pos = line.find('call')
            addr = line[call_pos + 7:]

            if addr.startswith('0x'):
                addr = addr.rstrip()
                offset = int(addr, 16)
                if not offset in funcs:
                    funcs[offset] = generate_asm_code(code_dict[offset])
            # else:
            #     offset_pos = addr.find('ds') + 3
            #     offset = int(addr[offset_pos:].rstrip(), 16)

            #     known = {
            #         0x47838C: 'GetSystemDefaultLangID',
            #         0x478390: 'GetAtomNameA',
            #         0x460210: 'SetErrorMode',
            #         0x4603d8: 'FindResourceA',
            #         0x4603e4: 'SizeofResource',
            #         0x4603dc: 'LoadResource',
            #         0x4603e0: 'LockResource',
            #         0x46023c: 'VirtualAlloc',
            #         0x478370: 'GetProcessHeap',
            #         0x46021c: 'HeapAlloc',
            #         0x460218: 'HeapFree',
            #         0x46022c: 'Sleep',
            #         0x478374: 'OpenMutexA',
            #         0x460230: 'ExitProcess',
            #         0x478378: 'CreateProcessA',
            #         0x47837c: 'VirtualAllocEx',
            #         0x478380: 'WriteProcessMemory',
            #         0x478384: 'QueueUserAPC',
            #         0x478388: 'ResumeThread',
            #         0x460398: 'GetModuleFileNameA',
            #         0x4783c4: 'InitializeSecurityDescriptor',
            #         0x4783c8: 'SetSecurityDescriptorDacl',
            #         0x4601f0: 'CreateFileA',
            #         0x4602f8: 'WriteFile',
            #         0x460340: 'CloseHandle'
            #     }

            #     formatted = ''
            #     if offset in known:
            #         formatted = known[offset]
            #     else:
            #         formatted = f'ds:{hex(offset)}'

            #     line = line[:call_pos] + f'call   ds:{formatted}'
            
            dis += line + '\n'
            curr += 1
            continue
        
        cmd = line[40:43]
        operand = line[47:].rstrip()

        if cmd in ['jge', 'jg', 'jl', 'jle', 'je', 'jne']:
            branch_offset = int(operand, 16)
            branch_line_idx = code_dict[branch_offset]
            branches.append(branch_line_idx)
            
        if not 'jmp' in line:
            dis += line + '\n'
            curr += 1
            continue
    
        jmp_pos = line.find('jmp')
        offset_str = line[jmp_pos + 7:]
        offset = int(offset_str, 16)
        jmp_line_idx = code_dict[offset]

        if jmp_line_idx in visited:
            break
        
        curr = jmp_line_idx
    
    dis += disasmed[curr] + '\n'

    for branch in branches:
        if not branch in visited:
            dis += generate_asm_code(branch)

    return dis

def remove_obfuscation(func):
    func = func.split('\n')
    curr = 0

    new_func = ''

    while curr < len(func):
        line = func[curr]

        if 'push' in line:
            next_line = func[curr + 1]
            next_cmd = next_line[40:43]
            
            if not next_cmd in ['mov', 'sub', 'xor', 'add', 'mul']:
                curr += 1
                new_func += line + '\n'
                continue

            register_pos = line.find('push') + 7
            register = line[register_pos:].rstrip()

            obfuscation_end = curr + 1

            while True:
                if obfuscation_end >= len(func):
                    break
                
                if not register in func[obfuscation_end]:
                    break
                
                cmd = func[obfuscation_end][40:43]
                if not cmd in ['mov', 'sub', 'xor', 'add', 'mul']:
                    break
                
                operands = func[obfuscation_end].split(', ')
                operand = operands[-1].rstrip()

                if not operand.startswith('0x'):
                    break

                obfuscation_end += 1
            
            obfuscation_size = obfuscation_end - curr - 1

            if obfuscation_size < 4:
                curr += 1
                new_func += line + '\n'
                continue

            value = 0

            transformations = {
                'mov': lambda _, y: y,
                'sub': lambda x, y: (x - y) % 0xffffffff,
                'xor': lambda x, y: (x ^ y) % 0xffffffff,
                'add': lambda x, y: (x + y) % 0xffffffff,
                'mul': lambda x, y: (x * y) % 0xffffffff,
            }
            
            for idx in range(curr + 1, obfuscation_end):
                operation = func[idx][40:]
                cmd = operation[:3]

                if not cmd in transformations:
                    break

                transformation = transformations[cmd]
                operands = operation[3:].lstrip().split(', ')

                rvalue = int(operands[1], 16)
                value = transformation(value, rvalue)

            cmds = [func[curr]]
            cmds += [' ' * 40 + f'mov    {register}, {hex(value)}']

            new_func += '\n'.join(cmds) + '\n'
            curr = obfuscation_end

            continue

        curr += 1
        new_func += line + '\n'

    return new_func

funcs[0] = generate_asm_code(0)

for offset in funcs:
    func = funcs[offset]
    func = remove_obfuscation(func)
    funcs[offset] = func

    print(f'Function at offset: ##{hex(offset)}')
    print(func)
